						<div>Hello</div>
						<div>Hello</div>
						<div>Hello</div>
						<div>Hello</div>
					</GS.GridThree>
					<GS.GridTwo>
						<div>Hello</div>
						<div>Hello</div>
						<div>Hello</div>
						<div>Hello</div>
						<div>Hello</div>
						<div>Hello</div>
					</GS.GridTwo>
				</GS.MaxContainer>
			</Layout>
		</>
	);
}

export async function getStaticProps(context) {
	const posts = await getPosts();

	if (!posts) {
		return {
			notFound: true,
		};
	}

	return {
		props: { posts },
	};
}
